async function loadImage(src){ return new Promise((res,rej)=>{ const img=new Image(); img.crossOrigin='Anonymous'; img.onload=()=>res(img); img.onerror=rej; img.src=src; }); }
async function slice(){ const img = await loadImage(SPRITESHEET_URI); const cols = Math.floor(img.width/128)||1; const rows = Math.floor(img.height/128)||1; const tiles = []; const canvas = document.createElement('canvas'); canvas.width=128; canvas.height=128; const ctx = canvas.getContext('2d'); for(let r=0;r<rows;r++){ for(let c=0;c<cols;c++){ ctx.clearRect(0,0,128,128); ctx.drawImage(img, c*128, r*128, 128,128, 0,0,128,128); tiles.push(canvas.toDataURL('image/png')); }} return tiles; }
let ASSETS=null;
document.getElementById('startBtn').addEventListener('click', async ()=>{ document.getElementById('log').textContent='Carregando assets...'; ASSETS = {}; ASSETS.tiles = await slice(); ASSETS.avatar = ASSETS.tiles[0] || ''; document.getElementById('avatar').src = ASSETS.avatar; document.getElementById('log').textContent='Pronto — avatar carregado.'; });
document.getElementById('openChest').addEventListener('click', ()=>{ if(!ASSETS){ alert('Inicie primeiro'); return;} const tile = ASSETS.tiles[Math.floor(Math.random()*ASSETS.tiles.length)]; const img = new Image(); img.src=tile; img.width=64; img.height=64; document.getElementById('log').appendChild(img); });
</script>
